css:
.cli-status.panel {
  margin-bottom: 0px;
  white-space: pre;
  word-wrap: break-word;
  font-size: 14px;
  font-family: monospace;
}
.cli-status .panel-heading {
  padding: 2px;
  text-align: right;
}
.cli-status .panel-heading .btn {
  top: 0px;
}
.cli-status .terminal {
  max-height: 300px;
  overflow-y: scroll;
  bottom: 10px;
}
.cli-status .terminal .file-info {
  width: 140px;
  display: inline-block;
  float: left;
}
.cli-status .terminal .stat-program {
  color: #26c26a;
}
.cli-status .terminal .stat-link {
  color: #cd7de8;
}
.cli-status .terminal .clear {
  clear: both;
}
.cli-status .status-ignored {
  opacity: 0.5;
}
.cli-status .status-running {
  color: #00ffff;
}
.cli-status .status-info {
  color: #0055ff;
}
.cli-status .status-success {
  color: #55ff00;
}
.cli-status .status-error {
  color: #ff0000;
}
